    /// </summary>
    [CliOption("--worker-memory", Format = OptionFormat.EqualsSeparated)]
    public string? WorkerMemory { get; set; }

    /// <summary>
    /// Storage allocated to Airflow worker, ex. 600MB, 3GB, 2. If units are     not provided, defaults to GB.    Virtual Private Cloud networking
    /// </summary>
    [CliOption("--worker-storage", Format = OptionFormat.EqualsSeparated)]
    public string? WorkerStorage { get; set; }

    /// <summary>
    /// The Compute Engine Network to which the environment will be connected.     If a 'Custom Subnet Network' is provided, --subnetwork must be     specified as well.     This flag argument must be specified if any of the other arguments in     this group are specified.
    /// </summary>
    [CliOption("--network", Format = OptionFormat.EqualsSeparated)]
    public string? Network { get; set; }

    /// <summary>
    /// The Compute Engine Subnetwork     (https://cloud.google.com/compute/docs/subnetworks) to which the     environment will be connected.    At most one of these can be specified:     --web-server-allow-all      Allows all IP addresses to access the Airflow web server.     --web-server-allow-ip=[description=DESCRIPTION],[ip_range=IP_RANGE]      Specifies a list of IPv4 or IPv6 ranges that will be allowed to      access the Airflow web server. By default, all IPs are allowed to      access the web server.      This is a repeated argument that can be specified multiple times to      specify multiple IP ranges. (e.g.      --web-server-allow-ip=ip_range=130.211.160.0/28,description="office      network"      --web-server-allow-ip=ip_range=130.211.114.0/28,description="legacy      network")       ip_range        IPv4 or IPv6 range of addresses allowed to access the Airflow web        server.       description        An optional description of the IP range.     --web-server-deny-all      Denies all incoming traffic to the Airflow web server.
    /// </summary>
    [CliOption("--subnetwork", Format = OptionFormat.EqualsSeparated)]
    public string? Subnetwork { get; set; }

}
